#!/usr/bin/env python# -*- coding:utf-8 -*-# @Time : 2025/3/10# @Author : cyq# @File : push_onfig# @Software: PyCharm# @Desc:from fastapi import APIRouterfrom fastapi.params import Dependsfrom app.response import Responsefrom app.controller import Authenticationfrom app.model.base import Userrouter = APIRouter(prefix="/project/push/config", tags=["项目配置"])@router.post("/pushConfig", description="推送配置")async def add_push(pushValues:int,cr:User=Depends(Authentication())):    return Response.success()@router.post("/editConfig", description="修改推送配置")async def edit_push(pushValues:int,cr:User=Depends(Authentication())):    return Response.success()@router.post("/removeConfig", description="修改推送配置")async def remove_push(pushValues:int,cr:User=Depends(Authentication())):    return Response.success()@router.get("/queryConfig", description="修改推送配置")async def remove_push(pushValues:int,cr:User=Depends(Authentication())):    return Response.success()